import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircle, faHouse, faCaretLeft, faCaretRight, faGasPump } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';
import { FamilyCar, FuelType, AbstractCar } from '../models';
import { useCarsContext } from '../CarsContext';

const CarEngineForm = () => {
  const { car } = useCarsContext();

  const isFamilyCar = car instanceof FamilyCar;

  return (
    <div>
      <div className='engine-type'>
        <div className='header'>
          <Link to="/">
            <h3>
              <FontAwesomeIcon icon={faHouse} />
            </h3>
          </Link>
          <div className='progress'>
            <FontAwesomeIcon className="active" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
            <FontAwesomeIcon className="icon" icon={faCircle} />
          </div>
        </div>

        <h1>
          <FontAwesomeIcon icon={faGasPump} /> Engine {isFamilyCar && <p>This car is a FamilyCar.</p>}
        </h1>
        <div className=''>
          <div className='input engine-options'>
            {Object.values(FuelType).map((fuelType, index) => (
              <div className='input' key={index}>
                <h3>{fuelType}</h3>
              </div>
            ))}
          </div>
        </div>
        <div>
          <Link to="/">
            <button className='navButton'>
              <FontAwesomeIcon icon={faCaretLeft} />
            </button>
          </Link>
          <Link to="/select-color">
            <button className='navButton'>
              <FontAwesomeIcon icon={faCaretRight} />
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default CarEngineForm;
